import React from "react";
import "./CardsGrid.css";
import Card from "./Cards";
import faker from "faker";

const CardsGrid = (props) => {
  console.log(props);
  return (
    <div>
      <Card
        imgsrc={faker.image.avatar()}
        distance={20}
        ratings="4"
        link=""
        actual={props.distance}
      />
      <Card
        imgsrc={faker.image.avatar()}
        distance={30}
        ratings="4"
        link=""
        actual={props.distance}
      />
      <Card
        imgsrc={faker.image.avatar()}
        distance={40}
        ratings="4"
        link=""
        actual={props.distance}
      />
      <Card
        imgsrc={faker.image.avatar()}
        distance={50}
        ratings="3"
        link=""
        actual={props.distance}
      />
      <Card
        imgsrc={faker.image.avatar()}
        distance={60}
        ratings="4"
        link=""
        actual={props.distance}
      />
      <Card
        imgsrc={faker.image.avatar()}
        distance={90}
        ratings="4"
        link=""
        actual={props.distance}
      />
      <Card
        imgsrc={faker.image.avatar()}
        distance={100}
        ratings="4"
        link=""
        actual={props.distance}
      />
    </div>
  );
};

export default CardsGrid;
